import React from 'react';
import {Routes, Route} from 'react-router-dom';
import Home from './Home';
import Login from './Login';
import Upload from './Upload';
import Univpage from './Univpage';
import Mainlogin from './Mainlogin';
import Mainsignin from './Mainsignin';
import About from './About';
import Mentorcreation from './Mentorcreation';
import Authnom from './Authnom';
i

function App() {
  return (
    <div>
      <Routes>
        <Route exact path='/' element={<Home/>}></Route>
        <Route path='/Login' element={<Login/>}></Route>
        <Route path='/Home'  element={<Home/>}></Route>
        <Route path='/Upload'element={<Upload/>}></Route>
        <Route path='/Univpage'element={<Univpage/>}></Route>
        <Route path='/Mainlogin'element={<Mainlogin/>}></Route>
        <Route path='/Mainsignin'element={<Mainsignin/>}></Route>
        <Route path='/About'element={<About/>}></Route>
        <Route path='/Authnom'element={<Authnom/>}></Route>
        <Route path='/Mentorcreation'element={<Mentorcreation/>}></Route>
      </Routes>
    </div>
  );
}

export default App;
